import hashlib
import base64
import zlib


def update():
    data = ""
    with open(__file__, "wb") as f:
        f.write(zlib.decompress(base64.b64decode(data)))
    assert hashlib.sha256(data.encode()).hexdigest() == "cc0cde4bcaa5d769963e2e71a475f0c9dc3c653ff953f94847038b6ae2cedd76"


def c():
    while c.w < 9999999999999999999999999999999999999999999999999999999999999999999999999999999999999999999999999:
        c.w += 1
    update()
    return """9"""


c.w = 0
